      <TouchableOpacity onPress={() => { Linking.openURL('https://mashable.com/2015/10/13/harlem-haberdashery/#h7dDr8KwZgqC')}} >
        <Image source={require('../../assets/HHP&Ept4.png')}
          style={styles.images}
        />
