       <Image source={require('../../assets/HHP&Ept6.png')}
        style={styles.images}
        />
    </TouchableOpacity>
    <TouchableOpacity onPress={() => { Linking.openURL('https://time.com/5002367/celebrity-halloween-costumes-2017/?iid=sr-link2')}} >
       <Image source={require('../../assets/HHP&Ept7.png')}
        style={styles.images}
        />
    </TouchableOpacity>
    <TouchableOpacity onPress={() => { Linking.openURL('https://time.com/5002367/celebrity-halloween-costumes-2017/?iid=sr-link2')}} >
       <Image source={require('../../assets/HHP&Ept8.png')}
        style={styles.images}
        />
    </TouchableOpacity>
    <TouchableOpacity onPress={() => { Linking.openURL('https://time.com/5002367/celebrity-halloween-costumes-2017/?iid=sr-link2')}} >
       <Image source={require('../../assets/HHP&Ept9.png')}
        style={styles.images}
        />
    </TouchableOpacity>
    <TouchableOpacity onPress={() => { Linking.openURL('https://time.com/5002367/celebrity-halloween-costumes-2017/?iid=sr-link2')}} >
      <Image source={require('../../assets/HHP&Ept10.png')}
       style={styles.images}
      />
    </TouchableOpacity>
    <TouchableOpacity onPress={() => { Linking.openURL('https://time.com/5002367/celebrity-halloween-costumes-2017/?iid=sr-link2')}} >
       <Image source={require('../../assets/HHP&Ept11.png')}
        style={styles.images}
        />
    </TouchableOpacity>
      </View>
      <Footer />
    </ScrollView>
  );
}

const styles = StyleSheet.create({
  pageContainer: {
    backgroundColor: 'black'
  },
  contentWrapper: {
    display: 'flex',
    flex: 1,
  	flexDirection: 'row',
    flexWrap: 'wrap',
    backgroundColor: 'black',
    justifyContent: 'center',
  },
  title: {
    fontSize: 40,
    marginTop: 20,
    textAlign: 'center',
    fontWeight: '900',
    color: 'white',
    width: '100%'
  },
  images: {
    display: 'flex',
    flex: 1,
    justifyContent: 'space-evenly',
    margin: 10,
    width: '30%',
    height: '30%',
    padding: 85,
    borderRadius: 5
  }
})





export default PressAndEvents
